import React from 'react'

const bookterm = (props) =>{
return(
    <tr>
        <td>{props.term.name}</td>
        <td >{props.term.category}</td>
        <td >{props.term.author.name}</td>
        <td>{props.term.availableCopies}</td>


    </tr>
);
}
export default bookterm;
